import React from 'react';

const Navbar = (props) => {
    return (
        <header>
            <nav>
                <div></div>
                <div><a href="/"> THE LOGO </a></div>
                <div>
                    <ul>
                        <li><a href="/">Products</a></li>
                        <li><a href="/">Users</a></li>
                    </ul>
                </div>
            </nav>
        </header>
    )
}

export default Navbar;
